    "nos-co-ops-water-level-data-tide-prediction-60-minute",nt"isopen": false,nt"url":
    null,nt"notes": "This dataset has High Low Tide Predictions from NOAA NOS Center
    for OperationalnOceanographic Products and Services (CO-OPS).nnThe official Tide
    and Tidal Current prediction tables are published annually onnOctober 1, for the
    following calendar year. Tide and Tidal Current predictionsngenerated prior to the
    publishing date of the official tables are subject tonchange. The enclosed data
    are based upon the latest information available as ofnthe date of your request.
    Tide and Tidal Current predictions generated mayndiffer from the official predictions
    if information for the station requestednhas been updated since the publishing date
    of the official tables.nnWARNING:n* Queries for data MUST include stationID=, time>=
    and time<=.n  Queries MUST be for less than 30 days worth of data.n* This dataset
    only returns data for the MLLW (Mean Lower-Low Water) datum.n* The data source isn't
    completely reliable. If your request returns no datan  when you think it should:n
     * Try revising the request (e.g., a different time range).n  * The list of stations
    offering this data may be incorrect.n  * Sometimes a station or the entire data
    service is unavailable.n    Wait a while and try again.",nt"license_title":
